  const itemCard = () => { return(
    <li key ={item._id} className="mesto__item">
    <button className="mesto__delete-button"></button>
    <img className="mesto__image" src={item.link} />
    <div className="mesto__content">
      <h2 className="mesto__title">{item.name}</h2>
      <div className="mesto__like-container">
        <button className="mesto__like-button" type="button"></button>
        <p className="mesto__like-counter">{item.likes.length}</p>
      </div>
     </div>
  </li>

)}

}


